import { ElmUtils } from "../../utils/elm-utils";
import { SvgUtils } from "../../utils/svg-utils";

import styles from "./style/top-page.css";

/**
 * TopPage コンポーネント
 * @class TopPage
 * @extends {HTMLElement}
 */
export function TopPage() {
  class TopPage extends HTMLElement {
    /**
     * コンストラクタ
     * @constructor
     * @returns {void}
     * @description
     * SvgBtn コンポーネントのインスタンスを初期化するコンストラクタ。
     * Shadow DOM をオープンモードでアタッチし、CSSを適用し、ボタン要素を作成します。
     */
    constructor() {
      super();

      // Shadow DOMをオープンモードでアタッチ
      this.attachShadow({ mode: "open" });
      this.shadowRoot.innerHTML = "";

      // CSSを適用
      this.shadowRoot.adoptedStyleSheets = ElmUtils.createStylesheet(styles);

      // 要素作成
      this.root = ElmUtils.createElm("div", "root");
      this.root.appendChild(this.#createMainTitle());

      this.shadowRoot.appendChild(this.root);
    }

    /**
     * タイトルロゴ
     * @returns {string} title
     */
    #createMainTitle() {
      const logo = () => {
        return `data:image/png;base64,`;
      };
      const img = ElmUtils.createElm("img");
      img.src = logo();
      return img;
    }
  }
  customElements.define("top-page", TopPage);
}
